  return (
    <div className='mmm'>
      <Link to="/">HOME</Link>
      <Link to="about">ABOUT</Link>
      <Link to="contact">CONTACT</Link>
      <Link to="items">ITEMS</Link>
      <Link to="cart">CART</Link>
      <Link to="form">FORM</Link>
    </div>
  )
}

export default NAVBAR
